"use client"

import { motion, useInView } from "framer-motion"
import { useRef } from "react"

const collaborations = [
  { id: 1, image: "data:image/jpeg;base64,", brand: "Samsung", size: "large" },
  { id: 2, image: "data:image/jpeg;base64,", brand: "OnePlus", size: "large" },
  { id: 3, image: "data:image/jpeg;base64,", brand: "Apple", size: "large" },
  { id: 4, image: "data:image/jpeg;base64,", brand: "Xiaomi", size: "small" },
  { id: 5, image: "data:image/jpeg;base64,", brand: "Realme", size: "xlarge" },
  { id: 6, image: "data:image/jpeg;base64,", brand: "ASUS", size: "large" },
  { id: 7, image: "data:image/jpeg;base64,", brand: "Nothing", size: "large" },
  { id: 8, image: "data:image/jpeg;base64,", brand: "Google", size: "large" },
  { id: 9, image: "data:image/jpeg;base64,", brand: "Vivo", size: "large" },
]

export default function Collaboration() {
  const headingRef = useRef(null)
  const isHeadingInView = useInView(headingRef, { once: true, amount: 0.5 })

  return (
    <section
      id="collaboration"
      className="py-20 md:py-32 bg-black overflow-hidden scroll-mt-20"
    >
      {/* Styles */}
      <style>{`
        @keyframes marquee {
          0% { transform: translateX(0); }
          100% { transform: translateX(-50%); }
        }

        .marquee {
          display: flex;
          width: max-content;
          animation: marquee 45s linear infinite;
          will-change: transform;
          transform: translateZ(0);
        }

        .marquee.reverse {
          animation-direction: reverse;
        }

        @media (max-width: 768px) {
          .marquee {
            animation-duration: 35s;
          }
        }
      `}</style>

      {/* Heading */}
      <div className="container mx-auto px-6 md:px-12 mb-12 md:mb-16">
        <motion.h2
          ref={headingRef}
          initial={{ opacity: 0, y: 40 }}
          animate={isHeadingInView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-5xl md:text-6xl lg:text-7xl xl:text-8xl font-black text-white uppercase tracking-tight"
        >
          Collaboration
        </motion.h2>

        <motion.p
          initial={{ opacity: 0, y: 20 }}
          animate={isHeadingInView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="text-zinc-400 text-lg md:text-xl mt-4"
        >
          Trusted by leading tech brands worldwide
        </motion.p>
      </div>

      {/* Rows */}
      <motion.div
        initial={{ opacity: 0 }}
        animate={isHeadingInView ? { opacity: 1 } : {}}
        transition={{ duration: 0.8, delay: 0.4 }}
        className="space-y-5 md:space-y-3"
      >
        <MarqueeRow items={collaborations.slice(0, 3)} />
        <MarqueeRow items={collaborations.slice(3, 6)} reverse />
        <MarqueeRow items={collaborations.slice(6, 9)} />
      </motion.div>
    </section>
  )
}

/* ------------------ Components ------------------ */

function MarqueeRow({
  items,
  reverse = false,
}: {
  items: typeof collaborations
  reverse?: boolean
}) {
  return (
    <div className="overflow-hidden">
      <div className={`marquee ${reverse ? "reverse" : ""}`}>
        {[...items, ...items].map((item, index) => (
          <CollabCard key={index} data={item} />
        ))}
      </div>
    </div>
  )
}

function CollabCard({ data }: { data: any }) {
  const sizeMap: Record<string, string> = {
    small: "w-[200px] md:w-[220px]",
    large: "w-[280px] md:w-[320px]",
    xlarge: "w-[360px] md:w-[420px]",
  }

  return (
    <div
      className={`flex-shrink-0 ${
        sizeMap[data.size]
      } h-[180px] md:h-[200px] mx-3 md:mx-4 rounded-2xl overflow-hidden bg-zinc-900 border border-zinc-800/50 transition-transform duration-500 hover:scale-105 hover:border-orange-500/30 relative group`}
    >
      <img
        src={data.image}
        alt={data.brand}
        className="w-full h-full object-cover transition-transform duration-700 group-hover:scale-110"
      />

      {/* Dark overlay */}
      <div className="absolute inset-0 bg-gradient-to-t from-black via-black/50 to-transparent" />

      {/* Hover accent */}
      <div className="absolute inset-0 bg-gradient-to-t from-orange-500/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-500" />

      {/* Text */}
      <div className="absolute inset-0 flex items-end p-5 md:p-6">
        <div className="translate-y-2 group-hover:translate-y-0 transition-transform duration-500">
          <h3 className="text-white text-xl md:text-2xl font-black mb-1">
            {data.brand}
          </h3>
          <p className="text-zinc-300 text-xs md:text-sm opacity-0 group-hover:opacity-100 transition-opacity duration-500 delay-100">
            Brand Partnership
          </p>
        </div>
      </div>
    </div>
  )
}
